    internal static class BsCalender
    {
        private static DataTable _tableDate;
       
        public static DataTable TableDate
        {
            get 
            {
                if (_tableDate == null)
                {
                    try
                    {
                        ReadAll();
                    }
                    catch
                    {
                    }
                }
                return _tableDate;
            }
        }

        public static bool SaveChanges()
        {           
            var ds = new DataSet();
            ds.Tables.Add(_tableDate);
            ds.WriteXml("date.file", XmlWriteMode.WriteSchema);
            return true;
        }

       
        //##
        //## Private Methods 
        //##
        private static void ReadAll()
        {
            var ds = new DataSet();

            if (System.IO.File.Exists("date.file"))
            {
                 ds.ReadXml("date.file");
                _tableDate = ds.Tables[0];
            }

            if (_tableDate == null)
            {
                SetDefault();
                SaveChanges();
            }


        }

